  //····················································································································

  private var mSetOppositeRelationship : Optional < (_ inManagedObject : ArtworkRoot) -> Void > = nil
  private var mResetOppositeRelationship : Optional < (_ inManagedObject : ArtworkRoot) -> Void > = nil

